import styled from 'styled-components'

const Wrapper = styled.div`
  clear: both;
  position: relative;
  bottom: 0;
  height: 3.5rem;
  width: 100%;
  background: ${props => props.theme.color};
  color: ${props => props.theme.bgColor};
  margin-top: -3.5rem;
`

const Content = styled.div`
  margin: 0 auto;
  padding-bottom: 3.5rem;
`

export default () => (
  <Wrapper>
    <div>
      <h1>Buy Me A Coffee :-)</h1>
    </div>
  </Wrapper>
)
